import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- STRESS TEST CYCLE 1 ---

    // 1. Rapidly add multiple items to the cart
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    const addToCartButtons = await page.locator('.add-to-cart').all();
    const addPromises = [];
    // Add the first 4 available items
    for (let i = 0; i < Math.min(addToCartButtons.length, 4); i++) {
        addPromises.push(addToCartButtons[i].click());
    }
    await Promise.all(addPromises);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // 2. Open the cart and verify items were added
    const cartIcon = page.locator('div.cart');
    await cartIcon.click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open_with_items.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open_with_items.png'));

    const cartCountAfterAdd = await cartIcon.innerText();
    const itemsInCartCount1 = await page.locator('.cart-item').count();

    // 3. Rapidly remove all items from the cart
    const removeButtons = await page.locator('.remove-item').all();
    const removePromises = removeButtons.map(button => button.click());
    await Promise.all(removePromises);

    // 4. Verify cart is empty
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_empty.png'));

    const cartCountAfterRemove = await cartIcon.innerText();
    const emptyCartMessage = await page.locator('.empty-cart').innerText();

    // Close the cart modal by clicking on the body
    await page.locator('body').click({ position: { x: 5, y: 5 } });


    // --- STRESS TEST CYCLE 2 ---

    // 5. Rapidly add a different set of items
    const addToCartButtons2 = await page.locator('.add-to-cart').all();
    const addPromises2 = [];
    // Add items 5 through 7
    for (let i = 4; i < Math.min(addToCartButtons2.length, 7); i++) {
        addPromises2.push(addToCartButtons2[i].click());
    }
    await Promise.all(addPromises2);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_items_added_again.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_items_added_again.png'));

    // 6. Verify the second addition
    await cartIcon.click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_cart_open_again.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_cart_open_again.png'));

    const cartCountAfterAdd2 = await cartIcon.innerText();
    const itemsInCartCount2 = await page.locator('.cart-item').count();

    return {
      success: true,
      action: "Performed a rapid cart manipulation stress test by adding and removing items in two cycles.",
      extractedData: {
        cycle1: {
          cartCountAfterAdd: cartCountAfterAdd.trim(),
          itemsInCart: itemsInCartCount1,
          cartCountAfterRemove: cartCountAfterRemove.trim(),
          emptyCartMessage: emptyCartMessage.trim()
        },
        cycle2: {
          cartCountAfterAdd: cartCountAfterAdd2.trim(),
          itemsInCart: itemsInCartCount2
        }
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete the cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
